import React, { useEffect, useState } from 'react';
import { Link, useParams } from 'react-router-dom';
import Axios from 'axios';

const WorkoutTable = () => {
  const { tableName } = useParams();
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    Axios.get(`http://localhost:3001/tables/${tableName}`)
      .then((response) => {
        const data = response.data;
        setTableData(data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, [tableName]);

  return (
    <div className="bg-black py-8 w-full h-screen">
      <div className="container mx-auto px-4">
        <h1 className="text-2xl font-bold mb-4 text-Green text-center">{tableName}</h1>
        <div className="bg-Green grid grid-cols-4 rounded-md">
          <div className="bg-green-500 text-white px-4 py-2">Name</div>
          <div className="bg-green-500 text-white px-4 py-2 ">Sets</div>
          <div className="bg-green-500 text-white px-4 py-2 ">Reps</div>
          <div className="bg-green-500 text-white px-4 py-2 ">Weight</div>
          {tableData.map((exercise, index) => (
            <React.Fragment key={index}>
              <div className="bg-gray-300 text-black px-4 py-2 rounded-md">{exercise.Exercise}</div>
              <div className="bg-gray-300 text-black px-4 py-2 rounded-md">{exercise.Sets}</div>
              <div className="bg-gray-300 text-black px-4 py-2 rounded-md">{exercise.Reps}</div>
              <div className="bg-gray-300 text-black px-4 py-2 rounded-md">{exercise.Weight}</div>
            </React.Fragment>
          ))}
        </div>
        <div className="mt-4 flex justify-center">
          <Link to={`/table/doWorkout/${tableName}`} className="mr-4 bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-600">Begin Workout</Link>
          <Link to={`/table/editWorkout/${tableName}`} className="bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-600">Edit Workout</Link>
        </div>
      </div>
    </div>
  );
};

export default WorkoutTable;
